import React, { Component} from 'react';

//get patient schema
const Patient = require('../server/models/patient')


// Name, age, email, phone number, address, city, state, zipcode, sex
//Nine boxes for info
//Then 3 buttons for add, update, delete

class PatientForm extends Component {
    constructor(props) {
        super(props);
        const patient = {
            name: "",
            age: "",
            email: "",
            phoneNumber: "",
            address: "",
            city: "",
            state: "",
            zipCode: "",
            sex: ""
        }
    }

    render() {
        return(
            <div>
            <button>Add</button>
            <button>Delete</button>
            <button>Update</button>
            </div>
        )
    }
}

export default PatientForm;
